import React from 'react';
import { CheckCircle, Calendar, RefreshCw, ArrowLeft, Bell } from 'lucide-react';
import { useNavigate } from 'react-router-dom';

const Notifications = ({ theme }) => {
  const navigate = useNavigate();
  const isDark = theme === 'dark';

  const notifications = [
    {
      id: 1,
      title: "Details", // Generic Header
      typeLabel: "Registration Approved", // The specific type
      desc: "Your registration for 'AI & Future Tech Workshop' has been confirmed. Tap to view ticket.",
      time: "2h ago",
      icon: <CheckCircle size={20} color="#5c5cfc" />,
      bgColor: isDark ? 'rgba(92, 92, 252, 0.1)' : '#eff6ff',
      eventId: 1 
    },
    {
      id: 2,
      title: "Details",
      typeLabel: "New Event Added",
      desc: "'Inter-College Music Battle' is now open for registration. Check details.",
      time: "5h ago",
      icon: <Calendar size={20} color="#22c55e" />,
      bgColor: isDark ? 'rgba(34, 197, 94, 0.1)' : '#f0fdf4',
      eventId: 2 
    },
    {
      id: 3,
      title: "Details",
      typeLabel: "Event Updated",
      desc: "The location for 'University Basketball Finals' has been changed.",
      time: "Yesterday",
      icon: <RefreshCw size={20} color="#f59e0b" />,
      bgColor: isDark ? 'rgba(245, 158, 11, 0.1)' : '#fefce8',
      eventId: 3 
    },
    {
      id: 4,
      title: "Details",
      typeLabel: "Reminder",
      desc: "Don't forget, 'AI & Future Tech Workshop' starts tomorrow at 09:00 AM.",
      time: "2d ago",
      icon: <Bell size={20} color="#ef4444" />,
      bgColor: isDark ? 'rgba(239, 68, 68, 0.1)' : '#fef2f2',
      eventId: 1 
    }
  ];

  const styles = {
    container: { 
      padding: '20px', 
      backgroundColor: isDark ? '#0f172a' : '#fff', 
      minHeight: '100vh', 
      maxWidth: '430px', 
      margin: '0 auto',
      boxSizing: 'border-box',
      fontFamily: 'sans-serif'
    },
    header: {
      display: 'flex',
      alignItems: 'center',
      gap: '15px',
      marginBottom: '30px'
    },
    pageTitle: {
      margin: 0,
      fontSize: '24px',
      fontWeight: 'bold',
      color: isDark ? '#fff' : '#1e293b'
    },
    card: { 
      display: 'flex', 
      gap: '15px', 
      padding: '16px', 
      borderRadius: '20px', 
      border: isDark ? '1px solid #334155' : '1px solid #f1f5f9', 
      marginBottom: '15px', 
      backgroundColor: isDark ? '#1e293b' : '#fff',
      boxShadow: '0 4px 10px rgba(0,0,0,0.02)',
      cursor: 'pointer',
      transition: 'transform 0.2s ease'
    },
    iconBox: (bgColor) => ({
      width: '48px', 
      height: '48px', 
      borderRadius: '14px', 
      display: 'flex', 
      alignItems: 'center', 
      justifyContent: 'center', 
      flexShrink: 0, 
      backgroundColor: bgColor 
    }),
    cardContent: {
      flex: 1
    },
    cardHeader: {
      display: 'flex',
      justifyContent: 'space-between',
      marginBottom: '2px',
      alignItems: 'center'
    },
    mainTitle: {
      fontWeight: 'bold',
      color: isDark ? '#fff' : '#1e293b',
      fontSize: '16px'
    },
    time: {
      fontSize: '12px',
      color: '#94a3b8'
    },
    // NEW STYLE FOR THE SUBTITLE (e.g. "Registration Approved")
    subTitle: {
      display: 'block',
      fontSize: '13px',
      fontWeight: '700', // Bold
      color: '#5c5cfc',  // Blue color to make it pop
      marginBottom: '4px'
    },
    desc: {
      margin: 0,
      fontSize: '13px',
      color: '#64748b',
      lineHeight: '1.4'
    }
  };

  const handleNotificationClick = (eventId) => {
    if (eventId) {
      navigate(`/event-details/${eventId}`);
    }
  };

  return (
    <div style={styles.container}>
      <div style={styles.header}>
        <ArrowLeft 
          size={24} 
          onClick={() => navigate(-1)} 
          style={{ cursor: 'pointer', color: isDark ? '#fff' : '#1e293b' }} 
        />
        <h2 style={styles.pageTitle}>Notifications</h2>
      </div>

      {notifications.map((note) => (
        <div 
          key={note.id} 
          style={styles.card}
          onClick={() => handleNotificationClick(note.eventId)}
        >
          <div style={styles.iconBox(note.bgColor)}>
            {note.icon}
          </div>
          <div style={styles.cardContent}>
            <div style={styles.cardHeader}>
              {/* Main Title: "Details" */}
              <span style={styles.mainTitle}>{note.title}</span>
              <span style={styles.time}>{note.time}</span>
            </div>
            
            {/* Sub Title: "Registration Approved" */}
            <span style={styles.subTitle}>{note.typeLabel}</span>
            
            {/* Description text */}
            <p style={styles.desc}>{note.desc}</p>
          </div>
        </div>
      ))}
      
      {notifications.length === 0 && (
        <div style={{ textAlign: 'center', marginTop: '100px', color: '#94a3b8' }}>
          <p>No new notifications</p>
        </div>
      )}
    </div>
  );
};

export default Notifications;
